<!DOCTYPE html>
<html lang="en">
	<head>
		<meta charset="UTF-8">
		<meta http-equiv="X-UA-Compatible" content="IE=edge">
		<meta name="viewport" content="width=device-width, initial-scale=1.0">
		<!-- 1. 引入vue -->
		<script src="./plugins/vue-2.6.14/vue.js"></script>
		<!-- 2. 引入样式 -->
		<link rel="stylesheet" href="./plugins/element-ui-2.15.7/theme-chalk/index.css">
		<!-- 3. 引入组件库 -->
		<script src="./plugins/element-ui-2.15.7/index.js"></script>
		<!-- axio -->
		<script src="./plugins/axio-0.27.2/axios.js"></script>
		<title>上报</title>
		<style>
			@media (max-width: 768px) {
				.el-date-range-picker .el-picker-panel__body {
					min-width: 100%;
				}

				.el-date-range-picker__content {
					width: 100% !important;
				}

				.el-date-range-picker {
					width: 80% !important;
				}

				.el-date-range-picker__content {
					margin: 0px;
					padding: 5px;
				}

				.el-date-range-picker__content.is-left {
					padding-bottom: 0px;
				}

				.el-date-range-picker__content.is-right {
					padding-top: 0px;
				}

				.el-date-table th {
					padding: 0px;
				}

				.el-date-table td {
					padding: 0px;
				}
			}
		</style>
	</head>
	<body>
		<div id="app">
			<el-form ref="elForm" :model="formData" :rules="rules" size="medium" label-width="100px" v-if="elFormShow"
				label-position="top">
				<el-form-item label="上报人姓名" prop="name">
					<el-input v-model="formData.name" placeholder="请输入上报人姓名" show-word-limit clearable
						:style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="上报人手机号" prop="phone">
					<el-input v-model="formData.phone" placeholder="请输入上报人手机号" :maxlength="11" clearable
						:style="{width: '100%'}">
					</el-input>
				</el-form-item>
				<el-form-item label="患者姓名" prop="patientName">
					<el-input v-model="formData.patientName" placeholder="请输入患者姓名" show-word-limit clearable
						:style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="患者性别" prop="gender">
					<el-radio-group v-model="formData.gender" size="medium">
						<el-radio v-for="(item, index) in genderOptions" :key="index" :label="item.value"
							:disabled="item.disabled">{{item.label}}</el-radio>
					</el-radio-group>
				</el-form-item>
				<el-form-item label="患者其他信息" prop="patientOtherInfo">
					<el-input v-model="formData.patientOtherInfo" type="textarea" placeholder="请输入患者其他信息，如年龄、身高、体重等"
						:autosize="{minRows: 4,}" :style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="事件发生单位" prop="reactionOfUnit">
					<el-input v-model="formData.reactionOfUnit" placeholder="请输入事件发生单位" clearable :style="{width: '100%'}">
					</el-input>
				</el-form-item>
				<el-form-item label="药品名称" prop="productName">
					<el-input v-model="formData.productName" placeholder="请输入药品名称" clearable :style="{width: '100%'}">
					</el-input>
				</el-form-item>
				<el-form-item label="药品批号" prop="batchNo">
					<el-input v-model="formData.batchNo" placeholder="请输入药品批号" clearable :style="{width: '100%'}">
					</el-input>
				</el-form-item>
				<el-form-item label="治疗疾病" prop="patientDisease">
					<el-input v-model="formData.patientDisease" placeholder="请输入治疗疾病" show-word-limit clearable
						:style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="用药起止时间" prop="usedDate">
					<el-date-picker v-model="formData.usedDate" type="daterange" range-separator="至"
						start-placeholder="开始日期" end-placeholder="结束日期" :editable="false" @change=""
						:picker-options="pickerOptions"	value-format="yyyy-MM-dd"></el-date-picker>
				</el-form-item>
				<el-form-item label="用法用量" prop="usageAndDosage">
					<el-input v-model="formData.usageAndDosage" type="textarea" placeholder="请输入用法用量"
						:autosize="{minRows: 4,}" :style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="合并用药信息" prop="combinedMedicine">
					<el-input v-model="formData.combinedMedicine" type="textarea" placeholder="请输入合并用药信息"
						:autosize="{minRows: 4,}" :style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="疑似不良反应描述" prop="description">
					<el-input v-model="formData.description" type="textarea" placeholder="请输入疑似不良反应描述，如吃药后10分钟后发热、呕吐等症状"
						:autosize="{minRows: 4}" :style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="采取措施" prop="takeAction">
					<el-input v-model="formData.takeAction" type="textarea" placeholder="请输入采取措施"
						:autosize="{minRows: 4,}" :style="{width: '100%'}"></el-input>
				</el-form-item>
				<el-form-item label="附件（请上传原始资料，确保信息真实可追溯）" prop="fileList">
					<el-upload ref="upload" 
						:limit="5" 
						:on-exceed="handleExceed" 
						:action="upload.url"
						:before-upload="handleBeforeUpload"
						:on-remove="handleRemove" 
						:on-progress="handleFileUploadProgress"
						:on-success="handleFileSuccess" 
						:on-error="handleFileError" 
						:auto-upload="true" 
						multiple
						>
						<el-button slot="trigger" size="small" type="primary">选取上传<i
								class="el-icon-upload el-icon--right" ></i></el-button>
						<div slot="tip" class="el-upload__tip">
							最多上传5个附件，每个附件大小不能超过10M！
						</div>
					</el-upload>
				</el-form-item>
				<el-form-item>
					<el-button type="primary" v-if="submitButtonFlag" @click="submitForm">提交</el-button>
				</el-form-item>
			</el-form>
			<el-row v-if="!elFormShow">
				<el-col :sm="12" :lg="6">
					<el-result icon="success" title="提交成功" sub-title="感谢您的反馈">
					</el-result>
				</el-col>
			</el-row>
			<el-dialog title="提示" :visible.sync="dialogVisible" width="100%">
				<span>{{errorMsg}}</span>
				<span slot="footer" class="dialog-footer">
					<el-button type="primary" @click="dialogVisible = false">确 定</el-button>
				</span>
			</el-dialog>
		</div>
	</body>
